import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import Users from "./user/places/users"

const  App = () => {
  return (
    <Router>
      <Switch>

        <Route path="/" component={Users} exact/>
      </Switch>
    </Router>
  );
}

export default App;
